import React, { Suspense } from 'react';
import Icon from './Icon';
import ThemeProvider from '../../utils/theme';
export default {
  title: 'Icon',
  component: Icon,
  parameters: {
    layout: 'centered'
  },
  tags: ['autodocs'],
  argTypes: {}
};
let key = 'AddSvg';
const icons = {
  // Define your icons here
  AddSvg: React.lazy(() => import('../Icons/' + key)),
  AlarmOffSvg: React.lazy(() => import('../Icons/AlarmOffSvg'))
  // Add other icons
};

const Story = () => {
  console.error('icons', icons);
  return <ThemeProvider>
      <Suspense fallback={<div>Loading...</div>}>
        {Object.keys(icons).map(key => {
        const IconComponent = icons[key];
        return <div key={key}>
              <span style={{
            fontSize: '10px',
            color: '#fff'
          }}>{key}</span>
              <IconComponent />
            </div>;
      })}
      </Suspense>
    </ThemeProvider>;
};
export const Docs = Story.bind({});
